  [],\n\t\"revision_timestamp\": \"2015-09-26T21:36:30.425042\",\n\t\"name\": \"auroral-electrojet-index-designed-to-provide-a-global-measure-hourly-intervals-of-auroral-zone-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Auroral Electrojet (AE) index is designed
  to provide a global quantitative measure of auroral zone magnetic activity produced
  by enhanced ionospheric currents flowing below and within the auroral oval. Ideally,
  it is the total range of deviation at an instant of time from quiet day values of
  the horizontal magnetic field (H) around the auroral oval. The hourly AE, AL, AU,
  and AO indices were derived from hourly scaled values of magnetic horizontaln                    intensity
  or the means of indices measured at finer sample increments (2.5 or 1.0-minute).
  These indices are derived from a network of geomagnetic observations that encircle
  the northern auroral oval.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
